/**
 * Creates GAQL date range conditions. Please use this function if there is
 * no predefined conditions that meet your requirement.
 * https://developers.google.com/google-ads/api/docs/query/date-ranges
 *
 * e.g.
 * Today: 20220615
 * Parameter: 60
 * Returns: segments.date BETWEEN '2022-04-16' AND '2022-06-15'
 *
 * @param {number} days
 *
 * @return {!string}
 */
const createCustomGaqlDateRangeLastXDays = (days) => {
  const format = 'yyyy-MM-dd';
  const millis_per_day = 1000 * 60 * 60 * 24;
  const now = new Date();

  const xDaysAgo = new Date(now.getTime() - millis_per_day * days);

  const time1 = Utilities.formatDate(xDaysAgo, AdsApp.currentAccount().getTimeZone(), format);
  const time2 = Utilities.formatDate(now, AdsApp.currentAccount().getTimeZone(), format);

  return `segments.date BETWEEN '${time1}' AND '${time2}'`;
};

