  const UNIQUE_CITIES = new Set(GROUPED_JP_CITIES.flat(Infinity));

  let locations = [];

  for (let match of text.matchAll(JP_CITIES_REGEX)) {
    match = match[0].replace(/\s+/g, '');

    // If it doesn't find the match, it will guess the closest location string.
    if (UNIQUE_CITIES.has(match)) {
      locations.push(match);
    } else {
      let candidateGroups = GROUPED_JP_CITIES;
      // Filters candidate groups to include cities that have already been
      // matched.
      if (locations.length > 0) {
        candidateGroups = candidateGroups.filter(
            (candidateGroup) => candidateGroup.find(
                cityInCandidateGroup =>
                    locations.includes(cityInCandidateGroup)));
      }
      // Filters candidate groups to include match string.
      candidateGroups = candidateGroups.filter(
          (candidateGroup) => candidateGroup.find(
              cityInCandidateGroup =>
                  cityInCandidateGroup.slice(0, -1) === match));

      // Flattens candidate groups, deduplicates, and filters candidate cities
      // to include match string.
      let candidateCities =
          Array.from(new Set(candidateGroups.flat(Infinity)))
              .filter((candidateCity) => candidateCity.slice(0, -1) === match);
      // Filters out candidate cities that have been already been matched.
      candidateCities = candidateCities.filter(
          (candidateCity) => !locations.includes(candidateCity));


      if (locations.length > 0) {
        // Filters out cities with the same unit as already matched.
        const matchedCitiesUnits = locations.map((city) => city.slice(-1));
        candidateCities = candidateCities.filter(
            (candidateCity) =>
                !matchedCitiesUnits.includes(candidateCity.slice(-1)));

        //  Filters out cities with the same level unit cities as already
        //  matched.
        if (locations.some(
                location => PREFECTURE_UNITS.includes(
                    location.slice(-1)))) {
          candidateCities = candidateCities.filter(
              (candidateCity) =>
                  !PREFECTURE_UNITS.includes(candidateCity.slice(-1)));
        }
      }

      // Sorts by the unit-size
      candidateCities.sort(
          (a, b) => UNITS.indexOf(a.slice(-1)) - UNITS.indexOf(b.slice(-1)));

      candidateCities.length > 0 && locations.push(candidateCities[0]);
    }
  }


  return locations;
